import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { Container, AppBar, Toolbar, Button, Box } from "@mui/material";
import { styled } from "@mui/system";

import Adminresister from "./Adminresister";
import Adminlogin from "./Adminlogin";
import Customerresister from "./Customerresister";
import Customerlogin from "./Customerlogin";

// Styled component for the background
const GlassBackground = styled(Box)({
  minHeight: "100vh",
  background: "rgba(173, 216, 230, 0.2)",
  backdropFilter: "blur(10px)",
  display: "flex",
  flexDirection: "column",
  justifyContent: "center",
  alignItems: "center",
});

export default function App() {
  return (
    <Router>
      <GlassBackground>
        <AppBar position="static" style={{ background: "rgba(0, 0, 128, 0.6)" }}>
          <Toolbar>
            <Button color="inherit" component={Link} to="/Adminresister">
              Go to Admin Register
            </Button>
            <Button color="inherit" component={Link} to="/Adminlogin">
              Go to Admin Login
            </Button>
            <Button color="inherit" component={Link} to="/Customerresister">
              Go to Customer Resister
            </Button>
            <Button color="inherit" component={Link} to="/Customerlogin">
              Go to Customer Login
            </Button>
          </Toolbar>
        </AppBar>

        <Container style={{ paddingTop: "2rem" }}>
          <Routes>
            <Route path="/Adminresister" element={<Adminresister />} />
            <Route path="/Adminlogin" element={<Adminlogin />} />
            <Route path="/Customerresister" element={<Customerresister />} />
            <Route path="/Customerlogin" element={<Customerlogin />} />
            <Route path="/" element={<Adminresister />} /> {/* Default route */}
          </Routes>
        </Container>
      </GlassBackground>
    </Router>
  );
}
